import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';
import DistrictInfo from './DistrictInfo';
import { proxyUrls } from '../utils/MapConfig';
import Chart from './Chart';

const RowTwo = (props: IRowProps) => {

    const {
        color,
        height,
        padding
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <DistrictInfo 
                        title='Wähle einen Stadtteil aus.'
                        defaultText='Auswählen...'
                        fetchUrl={proxyUrls[3]}
                        />                        
                    }
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                    padding: padding,
                }}
                    content={'Extending Volunteered Geographic Information (VGI) with Geospatial Software as a Service: Participatory Asset Mapping Infrastructures for Urban Health, geoserver credetials, postgres user, Diagramm Legende Karte, selected Features dynamischer,  sql injection, loading while fetching'}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <Chart 
                        colors={['rgba(180,180,180,1)', 'rgba(180,5,50,1', 'rgba(15,15,150)']}
                        />
                    }
                />
            </div>
        </>
    )
}

export default RowTwo;
